import React from 'react'
import { Link } from 'react-router-dom'

const EventDetailPage = ({ id, title, description }) => {
  return (
    <>
      <h1><Link to='events/:id'>{title}</Link></h1>

      <p>{description}</p>

    </>
  )
}

export default EventDetailPage
